import React, { useEffect,useState } from "react";

import BtnPiePapTijRnd from "../Componentes/PiePapTijRnd.jsx";

import '../Css/PiedraPapelTijera.css';

function PiedraPapelTijera() {

  const rnd = () => {
    console.log("a");
  }


  return(
    <div className="cuerpo">
      <div className="cont1">
        <div className="piedra1">
          piedra
        </div>
        <div className="papel1">
          papel
        </div>
        <div className="tijera1">
          tijera
        </div>
      </div>
      <div className="cont2">
        <BtnPiePapTijRnd>a</BtnPiePapTijRnd>
        <button
          className="papel2"
          onClick={rnd}>
          papel
        </button>
        <button
          className="tijera2">
          tijera
        </button>
      </div>
    </div>
  )
}

export default PiedraPapelTijera;
